import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import { WhatshotIcon, } from '@material-ui/icons';

const useStyles = makeStyles({
    root: {
        width: "100%",
        position: "fixed",
        bottom: 0,
        backgroundColor: "#2d313a",
        zIndex: 100,
    },
});

export default function SimpleBottomNavigation() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    return (
        <BottomNavigation
            value={value}
            onChange={(event, newValue) => {
                setValue(newValue);
            }}
            showLabels
            className={classes.root}
        >
            <BottomNavigationAction style={{color:"white"}} label="Trending" icon={<WhatshotIcon />} />
            <BottomNavigationAction style={{color:"white"}} label="Movies" icon={<RestoreIcon />} />
            <BottomNavigationAction style={{color:"white"}} label="Tv Series" icon={<FavoriteIcon />} />
            <BottomNavigationAction style={{color:"white"}} label="Search" icon={<LocationOnIcon />} />
        </BottomNavigation>
    );
}
